import React, { useEffect, useState } from 'react';
import './wishlist.css';

const Wishlist = () => {

    const [testArray, setTestArray] = useState([]); 
    const [filteredTestArray, setFilteredTestArray] = useState([]); 

useEffect(() => {
    fetch('./products.json')
            .then(response => response.json())
            .then(data => {
                const array = data.map(product => product);
                setTestArray(array);
                //filter to only include first 6 in array (always 6)
                setFilteredTestArray(array.slice())
            })
            .catch(error => console.error('Error fetching products:', error));
}, [testArray]); 

    return (
        <div>
            <div className='temp-palelime-bg'>
                <div>
                    <h1>HELLO.</h1>
                    
                </div>
            </div>
        </div>
    )
}

export default Wishlist;
